import React from 'react';
import Home from './js/layout/home';

// import FlexBox from './js/layout/flexboxExample';
// import CssGridExample from './js/layout/cssGridExample';
import './sass/main.scss';

function App() {
  return (
    <div className='App'>
      <Home />
    </div>
  );
}

export default App;
